Lead_Referral_proces_1.query:
events = load "${App.Datasets.FscDemoEvent.FullyQualifiedName}";
leads = load "${App.Datasets.FscDemoLead.FullyQualifiedName}";
converted_leads = filter leads by 'STATUS' == "Converted" && 'ISCONVERTED' == "true";
leads_events = group leads by 'ID' left, events by 'LEADID';
converted_leads_events = group converted_leads by 'ID' left, events by 'LEADID';

leads_events_creation_to_first_touch = foreach leads_events generate first(leads.'OWNERNAME') as 'OWNERNAME', "1 - Creation to First Touch" as 'Field',
daysBetween(toDate(min(leads.'CREATEDDATE_sec_epoch')), toDate(min(events.'ACTIVITYDATE_sec_epoch'))) as 'Days';

leads_events_first_touch_to_conversion = foreach converted_leads_events generate first(converted_leads.'OWNERNAME') as 'OWNERNAME', "2 - First Touch to Conversion" as 'Field',
daysBetween(toDate(min(events.'ACTIVITYDATE_sec_epoch')), toDate(sum(converted_leads.'CONVERTEDDATE_sec_epoch'))) as 'Days';

leads_events_conversion_to_closedwon = foreach converted_leads_events generate first(converted_leads.'OWNERNAME') as 'OWNERNAME', "3 - Conversion to Closed Won" as 'Field',
daysBetween(toDate(sum(converted_leads.'CONVERTEDDATE_sec_epoch')), toDate(sum(converted_leads.'CONVERTEDOPPCLOSEDATE_sec_epoch'))) as 'Days';

result = union leads_events_creation_to_first_touch, leads_events_first_touch_to_conversion, leads_events_conversion_to_closedwon;

result = group result by ('OWNERNAME', 'Field');
result = foreach result generate  'OWNERNAME' as 'OWNERNAME', 'Field' as 'Field', avg('Days') as 'Days';

